const rowpic = () => {
  return (
    <div className="cardContainer text-center">
      {console.log(props)}
      <div className="cardContents">
        <div className="card">
          <img
            class="card-img-top"
            src={this.props.item.src}
            alt="Card image cap"
          />
          <div className="card-body">
            <p className="card-text">
              <Link href="#">{this.props.item.title}</Link>
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default rowpic;
